Desc:
Featuring Natasha Nice &amp; Inari Vachs!

The hottest lesbian babysitters in porn return in four sizzling vignettes from Sweetheart Video. Gorgeous legend Inari Vachs must return to work after her maternity leave has come to an end, so she hires curvy young beauty Natasha Nice to babysit. But the hard-bodied Inari soon learns that sweet Natasha has a penchant for seducing her employers. Meanwhile, a very pregnant Madison Young hires young brunette Aiden Ashley to help with preparations for her baby's arrival. But when Aiden realizes Madison is single, the slender beauty decides to offer Madison a little 'extra' assistance.

Lexi Belle is fed up with her jealous mom bossing her around. When she forces the hot young blonde to babysit for mom's best friend Teri Weigel, Lexi seeks revenge by seducing her instead. Finally, Lana Lopez suspects blonde teenager Jessie Andrews of having an affair with her husband. But while Jessie does have something to confess, it's not what the curvy Latina Lana expected. Written and directed by Nica Noelle.
